With the existence of an event that emits the blockhash and height of a block, we can create a contest on the parity of the blockhash being even or odd. contract BlockHashEmitter { event BlockHash(uint256 blockHeight, bytes32 blockHash); function emitBlockHash(uint256 _blockHeight) external { bytes32 hash = blockhash(_blockHeight); require(hash != bytes32(0)); emit BlockHash(_blockNumber, hash); }
} Integrating this emitter into a contest is extremely simple. The BlockHashContestFactory is a simple factory that creates a new contest for a given chain & block height. When live, anyone can resolve the contest by simply providing the right BlockHash event to the deployed resolver. contract BlockHashContestFactory { Contests public contests; BlockHashEmitter public emitter; // Same emitter deployed on every chain function newContest(uint256 _chainId, uint256 _blockNumber) public payable { IContestResolver resolver = new BlockHashResolver(contests, emitter, _chainId, _blockNumber); contests.newContest{ value: msg.value }(resolver, msg.sender); }
} contract BlockHashResolver is IContestResolver { Contests public contests; ContestOutcome public outcome; BlockHashEmitter public emitter; // The target chain & block height uint256 public chainId; uint256 public blockNumber; function resolve(Identifier calldata _id, bytes calldata _data) external { require(outcome == ContestOutcome.UNDECIDED); // Validate Log require(_id.origin == address(emitter), "not an event from the emitter"); require(_id.chainId == chainId, "must match target chain"); CrossL2Inbox(Predeploys.CROSS_L2_INBOX).validateMessage(_id, keccak256(_data)); bytes32 selector = abi.decode(_data[:32], (bytes32)); require(selector == BlockHashEmitter.BlockHash.selector, "incorrect event"); // Event should correspond to the right contest uint256 dataBlockNumber = abi.decode(_data[32:64], (uint256)); require(dataBlockNumber == blockNumber, "must match target block height"); // Resolve the contest (yes if odd, no if even) bytes32 blockHash = abi.decode(_data[64:], (bytes32)); outcome = uint256(blockHash) % 2 != 0 ? ContestOutcome.YES : ContestOutcome.NO; contests.resolveContest(this); } }

