} When live, anyone can resolve the contest by providing the GameWon or GameDraw event of the associated game from the TicTacToe contract. contract TicTacToeGameResolver is IContestResolver { Contests public contests; ContestOutcome public outcome; TicTacToe public tictactoe; // @notice Game for this resolver Game public game; constructor(Contests _contest, TicTacToe _tictactoe, uint256 _chainId, uint256 _gameId, address _creator) { contest = _contest; tictactoe = _tictactoe; game = Game({chainId: _chainId, gameId: _gameId, creator: _creator}); outcome = ContestOutcome.UNDECIDED; } // @notice resolve this game by providing the game ending event function resolve(Identifier calldata _id, bytes calldata _data) external { // Validate Log require(_id.origin == address(tictactoe)); CrossL2Inbox(Predeploys.CROSS_L2_INBOX).validateMessage(_id, keccak256(_data)); // Ensure this is a finalizing event bytes32 selector = abi.decode(_data[:32], (bytes32)); require(selector == TicTacToe.GameWon.selector || selector == TicTacToe.GameDraw.selector, "event not a game outcome"); // Event should correspond to the right game (uint256 _chainId, uint256 gameId, address winner,,) = abi.decode(_data[32:], (uint256, uint256, address, uint8, uint8)); require(_chainId == game.chainId && gameId == game.gameId); // Resolve based on if the creator has won (non-draw) outcome = winner == game.creator && selector != TicTacToe.GameDraw.selector ? ContestOutcome.YES : ContestOutcome.NO; contests.resolveContest(this); }
}

